// markers on load set up and info
async function allMarkers(){
  let currLtLng = await currLatLng()
  let data = await getData()
  currLtLng = [currLtLng.lat, currLtLng.lng]
  console.log(currLtLng);
// Uncaught (in promise) ReferenceError: distanceTo is not defined
  data.forEach(e => {
    siteLatLng = [+(e.lat), +(e.long)]
    // console.log(siteLatLng);
    // let distanceFromUser = currLtLng.distanceTo(siteLatLng)
    marker = L.marker(siteLatLng).on("click", function(event) {
      let nameTab1 = document.querySelector('#name1')
      let nameTab2 = document.querySelector('#name2')
      let nameTab3 = document.querySelector('#name3')
      let nameTab4 = document.querySelector('#name4')
      nameTab1.innerText = e.name
      nameTab2.innerText = e.name
      nameTab3.innerText = e.name
      nameTab4.innerText = e.name
      let tab1 = document.querySelector('#firstTab')
      let tab2 = document.querySelector('#secondTab')
      let webLink = document.querySelector('#webLink')
      tab1.innerText = `${e.description}

      General Location: ${e.state}, ${e.area}`
      tab2.innerText = `Overnight Facilities: ${e.overnightFacilities}
      
      ${e.open}
      
      Day Use Fee: ${e.dayUseFee}
      
      Is it a Resort: ${e.resort}
      
      Road Access: ${e.roadAccess}`
      document.querySelector('#googLink').setAttribute('href', e.googleLink)
      if(e.website !== 'N\/A'){
      webLink.innerText = e.website
      document.querySelector('#webLink').setAttribute('href', e.website)
    }
    })
    .addTo(map);
    console.log(marker);
    marker.bindPopup(`${e.name}<br><br>${e.lat}, ${e.long}`)
    markersLayer.addLayer(marker)
  });
console.log(data);
  
}
